ple testing via the Benjamini-Hochberg procedure. In this table you can click on a column to sort by that value. Also, in this table features were filtered by (Mean UMI counts \u003e 1.0) and the top N features by L2FC for each cluster were retained. Features with L2FC \u003c 0 or adjusted p-value \u003e= 0.10 were grayed out. The number of top features shown per cluster, N, is set to limit the number of table entries shown to 10,000; N=10,000/K^2 where K is the number of clusters. N can range from 1 to 50. For the full table, please refer to the 'differential_expression.csv' files produced by the pipeline.","title":"Top Features by Cluster (Log2 fold-change, p-value)"},"tables":{"clusterings":[{"key":"gene_expression_graphclust","name":"Graph-based","data":{"columns":[{"Header":"Feature","columns":[{"Header":"ID","accessor":"feature.id"},{"Header":"Name","accessor":"feature.fn"}]},{"Header":"Cluster 1","columns":[{"Header":"L2FC","accessor":"c1.l","greyedout":"c1.g"},{"Header":"p-value","accessor":"c1.p","greyedout":"c1.g"}]},{"Header":"Cluster 2","columns":[{"Header":"L2FC","accessor":"c2.l","greyedout":"c2.g"},{"Header":"p-value","accessor":"c2.p","greyedout":"c2.g"}]},{"Header":"Cluster 3","columns":[{"Header":"L2FC","accessor":"c3.l","greyedout":"c3.g"},{"Header":"p-value","accessor":"c3.p","greyedout":"c3.g"}]},{"Header":"Cluster 4","columns":[{"Header":"L2FC","accessor":"c4.l","greyedout":"c4.g"},{"Header":"p-value","accessor":"c4.p","greyedout":"c4.g"}]},{"Header":"Cluster 5","columns":[{"Header":"L2FC","accessor":"c5.l","greyedout":"c5.g"},{"Header":"p-value","accessor":"c5.p","greyedout":"c5.g"}]},{"Header":"Cluster 6","columns":[{"Header":"L2FC","accessor":"c6.l","greyedout":"c6.g"},{"Header":"p-value","accessor":"c6.p","greyedout":"c6.g"}]},{"Header":"Cluster 7","columns":[{"Header":"L2FC","accessor":"c7.l","greyedout":"c7.g"},{"Header":"p-value","accessor":"c7.p","greyedout":"c7.g"}]},{"Header":"Cluster 8","columns":[{"Header":"L2FC","accessor":"c8.l","
